function loosen_it(plus_minus, parameter, vector)
	result = similar(vector)
	for i=1:length(vector)
		if abs(vector[i]) < 1
			result[i] = plus_minus(vector[i], parameter)
		else
			result[i] = plus_minus(vector[i], abs(vector[i])*parameter)
		end
	end
	return result
end

